import { useState } from "react";
import Form from "./components/form";

function App() {
  const [matches, setMatches] = useState([]);
  return (
    <>
      <div className="app">
        <Form setMatches={setMatches([...matches], {mascotName: Form.mascotName, ownerName: Form.ownerName, date: Form.date, time: Form.time, sintomas: Form.sintomas})}/>
      </div>
    </>
  );
}

export default App;
